import React from "react";

function Resume() {
  return (
    <div style={{ textAlign: "center", padding: "20px" }}>
      <embed
        src="/resume.pdf"
        width="100%"
        height="900px"
        style={{ border: "none" }}
      />
    </div>
  );
}

export default Resume;
